scriptlet.script:
var command = "tracert";
var exception = "";

var maxHops = getInputValue("maxHops");
if (maxHops != null)
	command += " -h " + maxHops;
/*
var timeout = getInputValue("timeout");
if (timeout != null)
	command += " -w " + timeout;
*/
var remoteOS = getInputValue("remoteOS");
if (remoteOS == null) 
	exception = "Did not receive a valid input for 'remoteOS'. It is a required value for 'WMI' commands";
else if (remoteOS != "WINDOWS" && remoteOS != "LINUX" && remoteOS != "SOLARIS")
    exception = "remoteOS must have one of the following values: [WINDOWS, LINUX, SOLARIS]";//SUNOS, HPUX, AIX, MAC_OS

if (exception == "") {
	var targetHost = getInputValue("targetHost");
	if (targetHost != null)
		command += " " + targetHost;
	else
		exception = "targetHost is a required parameter for the tracert. Please verify that targetHost is specified in the arguments passed in.";
}

if (exception == "") {
	scriptletContext.put("command", command);
} else {
	scriptletContext.put("exception", exception);
	scriptletContext.put("returnResult", exception);
}

function getInputValue(inputName) {
    if ((typeof(scriptletContext.get(inputName)) != "undefined") && (scriptletContext.get(inputName) != ""))
        return scriptletContext.get(inputName);
    else
        return null;
}

// extend String object
String.prototype.replaceRecursive = function(target, replacement) {
    var aux = this; //we don't want to modify the String object
    while(aux.indexOf(target) != -1) {
        aux = aux.replace(target, replacement);
    }
    return aux;
}

var output = getInputValue("stdOut");
var returnCode = getInputValue("returnCode");

if(returnCode == 0 && output != null) {
	var outputLines = output.split("\n");

	// depending on if the target resolves to an alias, it maybe inside brackets or between two strings
	for(i=0; i<outputLines.length; i++) {
		if(outputLines[i].indexOf("Tracing route to ") != -1) {
			var value = extractValue(outputLines[i], " [", "]");
			if(value == null) {
				value = extractValue(outputLines[i], "Tracing route to ", " over a maximum");	
			}
			scriptletContext.put("address", value);
			break;
		}
	}

	var times = "";
	var hops = "";
	// If an target is an alias or an IP that resolves to an alias in DNS, there is an additional line to skip
	var startIndex = 0;
	for(var i = 0; i<outputLines.length; i++) {
		if(outputLines[i].indexOf(" 1 ") != -1) {
			startIndex = i;
			break;
		}
	}
	for(var i = startIndex; i < (outputLines.length-2); i++) {
	    var line = outputLines[i].trim(); 
        if(line.length() != 0 && !line.indexOf("Request timed out.") != -1) { //it should be line.length
            // Replace all ms strings and trim spaces.

			var aux = line.replaceRecursive("ms","").replaceRecursive("  "," ");

			// get components
			var lineItems = aux.split(" ");
			if (lineItems.length == 0)
				continue;
			scriptletContext.put("ll"+i, "|"+lineItems.length+"|");
			times += lineItems[1] + " " + lineItems[2] + " " + lineItems[3] + ",";
			// if DNS alias of the visited node is available there will be 6 elements
			if(lineItems.length == 5) {
				hops += lineItems[4] + ",";
			} else {
				hops += lineItems[4] + " " + lineItems[5] + ",";
			}
		}
	}
	if(times.length > 0)
		times = times.substring(0, times.length-1);
	if(hops.length > 0)
		hops = hops.substring(0, hops.length-1);

	scriptletContext.put("times", times);
	scriptletContext.put("hops", hops);
} else {
	scriptletContext.put("address",	"");
	scriptletContext.put("times",	"");
	scriptletContext.put("hops",	"");
}

function extractValue(output, key, endTag) {
	var value = null;
	var startIndex = -1;
	var valueStartIndex = -1;
	var endIndex = -1;

	startIndex = output.indexOf(key);
	valueStartIndex = startIndex + key.length;
	endIndex = output.indexOf(endTag, valueStartIndex);
	if(startIndex >= 0 && endIndex >= 0) {
		value = output.substring(valueStartIndex, endIndex);
	}
	return value;
}

function getInputValue(inputName) {
	if ((typeof(scriptletContext.get(inputName)) != "undefined") && (scriptletContext.get(inputName) != "")) {
		return scriptletContext.get(inputName);
	} else {
		return null;
	}
}
